import './App.css';
import React, {Fragment} from 'react';
import Navbar from './components/layout/Navbar';
import Landing from './components/layout/Landing';
import { Route } from 'react-router-dom';

const App = () => (
    <div className="App">
      <Fragment>
          <Navbar />
            <Route exact path='/' component={Landing} />
          <Landing />
      </Fragment>
      <h1>Hello</h1>
    </div>
);

export default App;
